import React from 'react';
import Data from './ListData.json';

function SearchBar() {
    {
        Data.map((post) => (
          <div key={post.id}>
            <p>{post.name}</p>
          </div>
        ));
      }
return <div>

    <div>
      <input placeholder="Search Collections"/>
    </div>

</div>


};

export default SearchBar;
